import searchIcon from './images/SearchIcon.png';

function Main(){
    return(
        <main class="main">
            <div class="container">
                <div class="main-wrapper">
                    <div class="if_empty">
                        <img src={searchIcon} alt="Search icon"></img>
                        <p class="text-block">
                            Start with searching<br/>a GitHub user
                        </p>
                    </div>
                </div>
            </div>
        </main>
    );
}

export default Main;
